  /**
   * render list html
   * @param {*} list 
   * @returns 
   */
  PoddinSDK.prototype.getTranscriptList = function (list) {
    let htmlStr = ''
    for (let i = 0, n = list.length; i < n; i++) {
      let fileduration = (parseInt(list[i].fileduration) / 60).toFixed(0);
      let minute = fileduration > 1 ? 'mins' : 'min';
      let importClassName = 'import-transcript hover:bg-gray-50 text-gray-700';
      htmlStr += /*html*/ `<div class="py-4 px-5 border-b border-gray-200 hover:bg-gray-50 flex justify-between">
        <div class="flex items-center max-w-[400px]">
          <div class="h-12 w-12">
            <svg width="49" height="49" viewBox="0 0 49 49" fill="none" xmlns="http://www.w3.org/2000/svg">
              <rect x="0.339844" y="0.0458984" width="48" height="48" rx="6" fill="#1E2731"/>
              <path fill-rule="evenodd" clip-rule="evenodd" d="M24.1748 27.2165H23.825C21.4217 27.2165 19.4736 25.2928 19.4736 22.9204V18.2971C19.4736 15.9237 21.4217 14 23.825 14H24.1748C26.1693 14 27.8501 15.3239 28.3645 17.131C28.4352 17.3787 28.2482 17.6246 27.9886 17.6246H26.8562C26.5142 17.6246 26.2362 17.8982 26.2362 18.2359V18.2368C26.2362 18.5755 26.5142 18.849 26.8562 18.849H27.9004C28.2463 18.849 28.5272 19.1255 28.5272 19.467C28.5272 19.8085 28.2463 20.085 27.9004 20.085H26.8562C26.5142 20.085 26.2362 20.3595 26.2362 20.6982C26.2362 21.0359 26.5142 21.3104 26.8562 21.3104H27.9004C28.2463 21.3104 28.5272 21.5869 28.5272 21.9293C28.5272 22.2699 28.2463 22.5463 27.9004 22.5463H26.8562C26.5142 22.5463 26.2362 22.8209 26.2362 23.1595C26.2362 23.4972 26.5142 23.7708 26.8562 23.7708H27.9334C28.1988 23.7708 28.3887 24.0272 28.3054 24.2759C27.7309 25.9844 26.0996 27.2165 24.1748 27.2165ZM30.5626 22.7828C30.5626 22.2538 30.9966 21.8262 31.5313 21.8262C32.066 21.8262 32.5 22.2538 32.5 22.7828C32.5 27.0866 29.2006 30.6404 24.9692 31.1177V33.0434C24.9692 33.5714 24.5352 34 24.0005 34C23.4648 34 23.0318 33.5714 23.0318 33.0434V31.1177C18.7994 30.6404 15.5 27.0866 15.5 22.7828C15.5 22.2538 15.934 21.8262 16.4687 21.8262C17.0034 21.8262 17.4374 22.2538 17.4374 22.7828C17.4374 26.3557 20.3814 29.2629 24.0005 29.2629C27.6186 29.2629 30.5626 26.3557 30.5626 22.7828Z" fill="white"/>
            </svg>
          </div>
          <div class="ml-3">
            <a class="w-[350px] block text-sm font-medium text-gray-900 items-center truncate" href="${this.config.appServer}/transcripts/${list[i]['id']}?current_page=1" target="_blank" title="${list[i]['filename']}">${list[i]['filename']}</a>
            <div class="text-xs text-gray-500 mt-2">
              ${fileduration} ${minute}&nbsp;·&nbsp;${list[i]['language_code']}&nbsp;·&nbsp;Uploaded on ${list[i]['transcript_version']||''} ${(new Date(list[i]['created_at'])).toDateString()}
            </div>
          </div>
        </div>
        <div class="flex items-center">`
      if (list[i]['status'] != 'completed') {
        importClassName = 'bg-gray-300 text-[#999DA2]';
        htmlStr += `<div class="bg-yellow-100 text-yellow-800 text-xs font-medium px-3 py-0.5 leading-5 rounded-full text-center mr-[152px]">Transcribing</div>`
      }
      if (list[i]['status'] == 'completed') {
        htmlStr += `<div class="bg-green-100 text-green-800 text-xs font-medium px-3 py-0.5 leading-5 rounded-full text-center mr-[152px]">Transcript done</div>`
      }
      htmlStr += `
          <button data-id="${list[i]['id']}" class="${importClassName} h-[30px] leading-[28px] w-[60px] bg-white border-gray-300 border text-xs rounded-[4px] text-center shadow-sm">Import</button>
        </div>
      </div>`
    }
    return htmlStr;
  }

