  /**
   * close all dialog
   */
  PoddinSDK.prototype.closeModal = function () {
    $('#j-tanscript-modal').remove();
    $('#j-oauth-modal').remove();
    this.stopButtonLoading();
  }

  PoddinSDK.prototype.startButtonLoading = function () {
    $('#j-podding-button-loading').show();
  }

  PoddinSDK.prototype.stopButtonLoading = function () {
    $('#j-podding-button-loading').hide();
  }

